import React from "react";
import "./App.css";

const myList = ["apple", "orange", "banana"];

const h1 = document.createElement("h1");
h1.innerHTML = "Apple";

function App() {
  return (
    <div className="App">
      <p>Hello</p>

      {myList.map((item) => (
        <p>{item}</p>
      ))}
    </div>
  );
}

export default App;
